import {Stack, Box, Button} from "@mui/material";

export const AppLayout = ({children}) => {
    return (
        <Stack height="100vh">
            <Stack>
                top
            </Stack>
            <Box sx={{flexGrow: 1, overflow: "auto"}}>
                {children}
            </Box>
            <Stack bgcolor={"lightgray"} direction={"row"}>
                <Button fullWidth>logout</Button>
                <Button fullWidth>btn</Button>
                <Button fullWidth>btn</Button>
            </Stack>
        </Stack>
    );
};
